const City = ({city}) => {
  console.log(city)
  return (
    <div>
      <button 
        key={city.id} 
        className="flex bg-gray border border-black rounded px-2 mx-2 capitalize">
          {city.name + " "} 
          <FaTimes onclick={() => onDelete(city.id)} className="bg-gray border border-black rounded my-auto ml-1"/>
      </button>
    </div>
  )
}

export default City
